import React from "react";
import {
  truck,
  cement,
  chemicals,
  bricks,
  flyash,
  sands,
} from "../../utils/Icon";

import { frame } from "../../utils/Constant";

const Frame = () => {
  return (
    <div className="Frame w-full h-auto">
      <div className="grid gap-4 grid-cols-4 grid-rows-2 ">
        {frame.map((k, i) => {
          return (
            <div className="ring-1 inline-flex items-center rounded-md bg-[#FFFFFF] justify-start relative min-h-[180px] w-auto">
              <span className="text-black text-xl align-center" key={i}>
                {k.title},
                {}
              </span>

              <div className="absolute bottom-0 right-0">{truck}</div>
            </div>
          );
        })}
      </div>
    </div>
  );
};

export default Frame;
